bool checkEquality(int a[], int b[], int n) {
    for (int i = 0; i < n; i++) {
        if (a[i] != b[i]) return 0;
    }
    return 1;
}

void solve()
{
    int n;
    cin >> n;
    int a[n], b[n];
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }
    for (int i = 0; i < n; i++) {
        cin >> b[i];
    }
    int c[n];
    for (int i = 1; i <= n; i++) {
        c[i - 1] = i;
    }
    int x, y;
    int i = 1;
    do {
        if (checkEquality(a, c, n)) x = i;
        if (checkEquality(b, c, n)) y = i;
        i++;
    }while(next_permutation(c, c + n));
    cout << abs(x - y);
}

int main()
{
    int t = 1;
    // cin >> t;
    for (int i = 1; i <= t; i++)
    {
        solve();
    }
    return 0;
}

