// convers√£o de n√∫meros double em char*
// Vers√£o: 0.1: 18/09/2025: inicial, funcional e para zeros e menores que 1

#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <stdbool.h> 

#define TAMANHOBUFFER 20   // esse √© o tamanho do "buffer" de doubletostr (n√£o contando com o caracter ASCII(0)) [√© limitado ao tamanho de unsigned long long]

// essa fun√ß√£o de exponencia√ß√£o √© especial para expoentes inteiros
double power_int(double base, int expoente) {
	if (expoente < 0) return power_int(1 / base, expoente * -1);   // quando "expoente" √© negativo, o resultado √© 1 / "base" elevado ao valor absoluto do "expoente"
	if (expoente == 0) return 1;   // quando "expoente" √© zero, o resultado √© um
	if (expoente % 2 == 0) return power_int(base * base, expoente / 2);   // quando "expoente" √© divis√≠vel por dois, o resultado √© "base"¬≤ elevado ao "expoente" / 2
	return base * power_int(base * base, (expoente - 1) / 2);    // quando "expoente" n√£o √© divis√≠vel por dois, o resultado √© "base" * ("base"¬≤ elevado a ("expoente" - 1) / 2)
}

// essa fun√ß√£o converte um double "valor" em um char* com o n√∫mero de "casas" decimais
// "casas" n√£o pode ser maior do que 18, porque sen√£o sai lixo
// funciona quando os d√≠gitos v√£o at√© pr√≥ximo a 9.223.372.036.854.775.807 por causa da convers√£o entre double e unsigned long long
char* doubletostr(double valor, int casas) {
    if (casas > 18) casas = 18;   // depois de 18, estoura digitos (mas veja que, na pr√°tica, s√≥ tem precis√£o de 15 a 17 casas)
    unsigned long long digitos = valor * power_int(10.0, casas) + 0.5;   // aqui, criamos um inteiro com os "digitos" rotacionados por "casas"
    char buffer[TAMANHOBUFFER + 1];   // "buffer" guardar√° o char* enquanto digitos ainda estiver sendo utilizado
    char* retorno;   // no final, esse ponteiro apontar√° para uma localiza√ß√£o na mem√≥ria alocada dinamicamente com o resultado
    buffer[TAMANHOBUFFER] = 0;   // inserimos o marcador de final do char* na posi√ß√£o final do "buffer"
    int atual = TAMANHOBUFFER - 1;   // o primeiro d√≠gito (a partir da direita) ser√° na posi√ß√£o anterior ao final do "buffer"

    while (atual >= 0 && (digitos > 0 || (casas > 0 && atual + casas >= TAMANHOBUFFER - 1 ))) {   // enquanto houver d√≠gitos e espa√ßo no buffer, iremos processar os d√≠gitos
        buffer[atual] = '0' + digitos % 10;   // pega o d√≠gito mais a direita que ainda estiver em "digitos" e coloca em "buffer"
        digitos = digitos / 10;   // retira o d√≠gito mais √† direita (dividir por zero um inteiro faz exatamente isso)
        atual--;   // movemos a posi√ß√£o atual no "buffer" um d√≠gito
        if (atual + casas == TAMANHOBUFFER - 1 && atual >= 0 && casas > 0) {   // verificamos se agora √© para colocar a v√≠rgula no lugar
            buffer[atual] = ',';   // coloca a v√≠rgula na posi√ß√£o atual
            atual--;   // move a posi√ß√£o atual no "buffer" uma v√≠rgula
            if (digitos == 0) {   // se, antes da v√≠rgula, n√£o existirem mais d√≠gitos
                buffer[atual] = '0';   // coloca um zero antes da v√≠rgula
                atual--;   // move a posi√ß√£o atual no "buffer" uma v√≠rgula
            }
        }
    }

    if (atual == TAMANHOBUFFER - 1) {   // se o n√∫mero for 0
        buffer[atual] = '0';   // inclui o 0
        atual--;   // move a posi√ß√£o atual 
    }

    retorno = (char*) malloc((TAMANHOBUFFER - atual) * sizeof(char));   // agora alocamos dinamicamente para poder ser resultado da fun√ß√£o
    if (retorno == NULL) return NULL;   // se n√£o conseguir alocar, retorna NULL (embora, na pr√°tica, isso nunca deve acontecer)
    strcpy(retorno, buffer + atual + 1);   // copia apenas os d√≠gitos (e eventual v√≠rgula) para o char* alocado dinamicamente

    return retorno;   // retorna o char* alocado dimamicamente
}

int main() {
	printf("Pot√™ncia: %f\n", power_int(10.0, 15));
    printf("Extenso: %s\n", doubletostr(123.45678905, 7));
    printf("Extenso: %s\n", doubletostr(123.45, 10));
    printf("Extenso: %s\n", doubletostr(123.45, 1));
    printf("Extenso: %s\n", doubletostr(0.000123, 10));
    printf("Extenso: %s\n", doubletostr(1.12345678901234567890, 19));
    printf("Extenso: %s\n", doubletostr(9223372036854775807, 0));
    printf("Extenso: %s\n", doubletostr(123456789012345678.9, 1));
	return 0;
}

// separa as s√©ries de exerc√≠cios em grupos entre 5 e 3 s√©ries e quando tomar √°gua
// essa vers√£o tenta fazer os grupos com o m√°ximo de s√©ries poss√≠vel (at√© 5)

#include <stdio.h> // printf/scanf
#include <stdlib.h>  // malloc/free

int main() {
	int series, grupos, iterador, atual, *quant;

    // pede um valor do total de s√©ries
	printf("Total de s√©ries: ");
	scanf("%i", &series);

    // calcula quantos grupos de s√©ries ser√£o feitos
    grupos = series / 5 + ((series % 5 > 0) ? 1 : 0);

    // aloca o n√∫mero de grupos de inteiros para quant
    quant = (int *) malloc(grupos * sizeof(int));

    // determina quantas s√©ries cada grupo vai ter, de tr√°s para a frente
    // a ideia √© dividir a quantidade de s√©reies que falta pelo n√∫mero de grupos que falta
    for(iterador = grupos - 1; iterador >= 0; iterador--) {
        atual = series / (iterador + 1);  // a quantidasde atual √© a parte inteira da divis√£o
        quant[iterador] = atual;
        series -= atual;  // aqui, na √∫ltima itera√ß√£o, ser√° exatamente a quantidade que faltava
    }

    // imprime o n√∫mero de grupos
	printf("Grupos: %d.\n", grupos);

    // imprime cada grupo e quantas s√©ries, e quando beber √°gua
    for(iterador = 0; iterador < grupos; iterador++) {
    	printf("Grupo %d: %d s√©ries.\nBeba √°gua!\n", iterador + 1, quant[iterador]);
    }

    // libera a mem√≥ria e sai do programa com o c√≥digo 0 (sucesso)
    free(quant);
    return 0;
}

