// define os valores de um parcelamento

#include <stdio.h> // printf/scanf
#include <stdlib.h>  // malloc/free

int main() {
	long centavos, numero, iterador, atual, *parcelas;
    double reais;

    // pede um valor do total em reais
	printf("Valor total em reais: ");
	scanf("%lf", &reais);
    centavos = reais * 100;  // calcular em centavos √© "redondo"

    // pede o n√∫mero de parcelas
	printf("N√∫mero de parcelas: ");
	scanf("%ld", &numero);

    // aloca o n√∫mero de parcelas
    parcelas = (long *) malloc(numero * sizeof(long));

    // determina o valor de cada parcela, sempre deduzindo do total o que j√° foi calculado
    for(iterador = numero - 1; iterador >= 0; iterador--) {
        atual = centavos / (iterador + 1);  // o valor atual √© a parte inteira da divis√£o
        parcelas[iterador] = atual;
        centavos -= atual;  // aqui, na √∫ltima itera√ß√£o, ser√° exatamente a quantidade que faltava
    }

    // imprime cada parcela
    for(iterador = 0; iterador < numero; iterador++) {
    	printf("Parcela %d: R$ %.2f.\n", iterador + 1, ((double) parcelas[iterador]) / 100.0);
    }

    // libera a mem√≥ria e sai do programa com o c√≥digo 0 (sucesso)
